function reportWeatherDataWithin20min() 
{
    if (context.weatherSummary == null || 
    context.weatherSummary.observation == null || 
    context.weatherSummary.observation.obsTime == null ||
    context.device == null ||
    context.device.datetime == null) {
        return false;
    }

    var obsTime = new Date(context.weatherSummary.observation.obsTime);
    var deviceTime =  new Date(context.device.datetime);

    var timeToObs = deviceTime - obsTime
    var min = Math.round(timeToObs / 60000)

    return ( min <= 20 );
}

reportWeatherDataWithin20min()

