function isPrecipIntensityInDailyForecast() {
    var dayCount = 5;
    var rainPercent = 80; // 80% chance
    var rainIconCode = 40; // heavy rain

    // adjusted for easy testing
    //rainPercent = 1;
    //rainIconCode = 12;

    if (context.weatherSummary.dailyForecasts === null) { return false; }
    if (Array.isArray(context.weatherSummary.dailyForecasts) === false) { return false; }
    if (context.weatherSummary.dailyForecasts.length < dayCount) { return false; }

    for (i = 0; i < dayCount; i+=1) {
        if (context.weatherSummary.dailyForecasts[i].day.precipPercentage >= rainPercent && context.weatherSummary.dailyForecasts[i].day.icon == rainIconCode) return true
        if (context.weatherSummary.dailyForecasts[i].night.precipPercentage >= rainPercent && context.weatherSummary.dailyForecasts[i].night.icon == rainIconCode) return true
    }

    return false
}

