function isPrecipIntensityInDailyForecast(range, rainPrecentCriteria, iconExtd, testing) {
    if (testing) {
    	return true;
    }

    if (context.weatherSummary.dailyForecasts === null) { return false; }
    if (Array.isArray(context.weatherSummary.dailyForecasts) === false) { return false; }
    if (context.weatherSummary.dailyForecasts.length < range) { return false; }

    var passed = true;

    for (i = 0; i < range; i+=1) {
    	// check day
        passed = passed && (context.weatherSummary.dailyForecasts[i].day.precipPercentage >= rainPrecentCriteria &&
        iconExtd.hasOwnProperty(context.weatherSummary.dailyForecasts[i].day.iconExtended));
        //check night
        passed = passed && (context.weatherSummary.dailyForecasts[i].night.precipPercentage >= rainPrecentCriteria &&
        iconExtd.hasOwnProperty(context.weatherSummary.dailyForecasts[i].night.iconExtended));

        if (passed) {
            return i;
        }
    }

    return -1
}

